import React from 'react';
import {Button} from '../ButtonElements';
import Icon1 from '../../images/svg-13.svg';
import Icon2 from '../../images/svg-14.svg';
import Icon3 from '../../images/svg-15.svg';
import{
    ServicesContainer,
    ServicesH1,
    ServicesWrapper,
    ServicesCard,
    ServicesIcon,
    ServicesH2,
    ServicesP,
    BtnWrap,
    BtnWrapper,
    ProjectLink
} from './ServicesElements';

const Services = () => {
    return (
        <>
          <ServicesContainer id="services">
          <ServicesH1>My Projects</ServicesH1>
          <ServicesWrapper>
              <ServicesCard>
                  <ServicesIcon src={Icon1} />
                  <ServicesH2>Portfolio App</ServicesH2>
                  <ServicesP>Web Portfolio devloped using React JS.</ServicesP>
                  <BtnWrapper>
                  <BtnWrap><Button to=""
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                >code</Button>
                  </BtnWrap>
                  <BtnWrap>
                 <Button to=""
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                >view</Button>
                 </BtnWrap>               
                 </BtnWrapper>    
              </ServicesCard>
              <ServicesCard>
                  <ServicesIcon src={Icon2} />
                  <ServicesH2>Weather App</ServicesH2>
                  <ServicesP>Fetched the real time data and tells the tempreature of location, devloped in React JS.</ServicesP>
                  <BtnWrapper>
                  <ProjectLink href="//www.facebook.com/tanishq.biswas" target="_blank" aria-label="Facebook">
                      
                  <BtnWrap><Button to=""
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                >code</Button>
                  </BtnWrap>
                  </ProjectLink>
                  <BtnWrap>
                  
                 <Button to=""
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                >view</Button>
                 </BtnWrap>               
                 </BtnWrapper>  
              </ServicesCard>
              <ServicesCard>
                  <ServicesIcon src={Icon3} />
                  <ServicesH2>Recipe Finder</ServicesH2>
                  <ServicesP>Tells the recipe of any cuisine, devloped in React JS.</ServicesP>
                  <BtnWrapper>
                  <BtnWrap><Button to=""
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                >code</Button>
                  </BtnWrap>
                  <BtnWrap>
                 <Button to=""
                                smooth={true}
                                duration={500}
                                spy={true}
                                exact="true"
                                offset={-80}
                                >view</Button>
                 </BtnWrap>               
                 </BtnWrapper>  
              </ServicesCard>
          </ServicesWrapper>  
          </ServicesContainer>  
        </>
    )
}

export default Services
